sourcesContent:
const questions = [
  {
    id: 1,
    questionText:
      "Consider two satellites S1 and S2 with periods of revolution 1 hr and 8 hr respectively revolving around a planet in circular orbits. The ratio of angular velocity of satellite S1 to the angular velocity of satellite S2 is",
    answerOptions: [
      { answerText: "8:1", isCorrect: true },
      { answerText: "1:8", isCorrect: false },
      { answerText: "2:1", isCorrect: false },
      { answerText: "1:4", isCorrect: false },
    ],
  },
  {
    id: 2,
    questionText: "Ohm is a unit of measuring _________?",
    answerOptions: [
      { answerText: "Resistance", isCorrect: true },
      { answerText: "Voltage", isCorrect: false },
      { answerText: "Current", isCorrect: false },
      { answerText: "None", isCorrect: false },
    ],
  },
  {
    id: 3,
    questionText:
      "An object is executing uniform circular motion. Which of the following quantities remain(s) constant during the object’s motion?",
    answerOptions: [
      { answerText: "Velocity and Acceleration", isCorrect: false },
      { answerText: "Speed and Velocity", isCorrect: false },
      { answerText: "Speed and Acceleration", isCorrect: false },
      { answerText: "Speed only", isCorrect: true },
    ],
  },
  {
    id: 4,
    questionText: `With reference to the Sound waves, which among the following is / are correct statements? \n  1. The frequency determines the pitch of a sound, and the amplitude determines the intensity (or loudness)
2. Frequency is proportional to amplitude \n
Select the correct option from the codes given below: `,
    answerOptions: [
      { answerText: "Only 1", isCorrect: false },
      { answerText: "Only 2", isCorrect: false },
      { answerText: "Both 1 and 2", isCorrect: false },
      { answerText: "Neither 1 or 2", isCorrect: true },
    ],
  },
  {
    id: 5,
    questionText: "What is dot product of two perpendicular vectors ?",
    answerOptions: [
      { answerText: 1, isCorrect: false },
      { answerText: 0, isCorrect: true },
      { answerText: -1, isCorrect: false },
      { answerText: 1 / 2, isCorrect: false },
    ],
  },
  {
    id: 6,
    questionText:
      "Which of the following provides potential energy to the object?",
    answerOptions: [
      { answerText: "Its momentum", isCorrect: false },
      { answerText: "Its position", isCorrect: true },
      { answerText: "Its acceleration", isCorrect: false },
      { answerText: "Its shape", isCorrect: false },
    ],
  },
  {
    id: 7,
    questionText: "Which of the following is part of Classical Physics",
    answerOptions: [
      { answerText: "OPtics", isCorrect: false },
      { answerText: "Thermodynamics", isCorrect: false },
      { answerText: "Both A & B", isCorrect: true },
      { answerText: "None", isCorrect: false },
    ],
  },
  {
    id: 8,
    questionText: "Who among the following Uncertainty Principle?",
    answerOptions: [
      { answerText: "R.A.Milkman", isCorrect: false },
      { answerText: "Ernest Rutherford", isCorrect: false },
      { answerText: "S.N bose", isCorrect: false },
      { answerText: "Werner Heisenberg", isCorrect: true },
    ],
  },
  {
    id: 9,
    questionText: "Which of the following physical quantities has no units?",
    answerOptions: [
      { answerText: "Pressure", isCorrect: false },
      { answerText: "Relative Density", isCorrect: true },
      { answerText: "Thrust", isCorrect: false },
      { answerText: "Density", isCorrect: false },
    ],
  },
  {
    id: 10,
    questionText: "Light year is a unit of which of these following?",
    answerOptions: [
      { answerText: "Distance", isCorrect: true },
      { answerText: "Speed", isCorrect: false },
      { answerText: "Intensity of light", isCorrect: false },
      { answerText: "Time", isCorrect: false },
    ],
  },
];

export default questions;
